        r = abs(r)
        h = abs(h)
        if r2:
            r2 = abs(r2)
    if r == 0 or h == 0 or (r2 != None and r2 == 0):
        return (0, 0)
    elif r < 0 or h < 0 or (r2 != None and r2 < 0):
        return (None, None)
    elif r2 is None:
        l = math.sqrt(r ** 2 + h ** 2)
        lsa = math.pi * r * l
        volume = 1 / 3 * math.pi * r ** 2 * h
        return (lsa, volume)
    else:
        l = math.sqrt((r * r2) ** 2 + h ** 2)
        lsa = math.pi * (r + r2) * l
        area = math.pi * (r ** 2 + r2 ** 2)
        tsa = lsa + area
        volume = 1 / 3 * math.pi * h * (r ** 2 + r2 ** 2 + r * r2)
        return (tsa, volume)

